    handleScroll=()=>{
        window.scroll({top:0,behavior:'smooth'})
    
    }
    componentDidMount() {
        this.handleScroll()

    }

    render() {
        
        return (
            <div>

                <p>
                    This week, when you do your mood logs, try using the body scan worksheet first. The body scan worksheet might help you do the mood log. 
                </p>  
